import {filterReducer} from "./filter/filterSlice";
import {todoListReducer} from "./todo/TodoSlice";

export const rootReducer = (state, action) => {
   return {
       filter:filterReducer(state,action),
       todoList:todoListReducer(state,action)
   }
}
